import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="row w300px bg-main padding-to-5em">
      <button type="button" className="bg-sub btn">
        <span className="text_href">새 프로젝트 추가</span>
      </button>
      <nav className="row padding-y-2em">
        <ul>
          <li><Link to="/" className="nav">대시보드</Link></li>
          <li><Link to="/project-view" className="nav">내 프로젝트</Link></li>
          <li className="active_menu">
            <Link to="#" className="nav">팀 활동</Link>
            <ul className="nav_sub">
              <li><Link to="/employee-management">직원 관리</Link></li>
              <li><Link to="/project-management">프로젝트 관리</Link></li>
              <li><Link to="/statistics-management">통계 및 분석</Link></li>
            </ul>
          </li>
          <li><Link to="/commute-view" className="nav">출퇴근 및 기타 관리</Link></li>
        </ul>
      </nav>
    </div>
  );
};

export default Sidebar;
